public class InnerInferenceSchedulerDataInputConfigurationFactory(Action<Humidifier.LookoutEquipment.InferenceSchedulerTypes.DataInputConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.LookoutEquipment.InferenceSchedulerTypes.DataInputConfiguration>
{

    internal InnerInferenceSchedulerInputNameConfigurationFactory InferenceInputNameConfigurationFactory { get; set; }

    internal InnerInferenceSchedulerS3InputConfigurationFactory S3InputConfigurationFactory { get; set; }

    protected override Humidifier.LookoutEquipment.InferenceSchedulerTypes.DataInputConfiguration Create()
    {
        var dataInputConfigurationResult = CreateDataInputConfiguration();
        factoryAction?.Invoke(dataInputConfigurationResult);

        return dataInputConfigurationResult;
    }

    private Humidifier.LookoutEquipment.InferenceSchedulerTypes.DataInputConfiguration CreateDataInputConfiguration()
    {
        var dataInputConfigurationResult = new Humidifier.LookoutEquipment.InferenceSchedulerTypes.DataInputConfiguration();

        return dataInputConfigurationResult;
    }
    public override void CreateChildren(Humidifier.LookoutEquipment.InferenceSchedulerTypes.DataInputConfiguration result)
    {
        base.CreateChildren(result);

        result.InferenceInputNameConfiguration ??= InferenceInputNameConfigurationFactory?.Build();
        result.S3InputConfiguration ??= S3InputConfigurationFactory?.Build();
    }

} // End Of Class

